import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {
    faTwitter,
    faDiscord,
    faInstagram
  } from "@fortawesome/free-brands-svg-icons";

function Icons() {
    return (
        <React.Fragment>
            <a href="https://discord.gg/p9qmmvuk" target="_blank" rel="noreferrer" className="AppFooter-discord">
              <FontAwesomeIcon icon={faDiscord} />
            </a>
            <a href="https://www.instagram.com/sparkylebold14/" target="_blank" rel="noreferrer" className="AppFooter-instagram">
              <FontAwesomeIcon icon={faInstagram} />
            </a>
            <a href="https://twitter.com/NftAgent14" target="_blank" rel="noreferrer" className="AppFooter-twitter">
              <FontAwesomeIcon icon={faTwitter} />
            </a>
        </React.Fragment>
      );
}

export default Icons;
